import messagingService from 'js/messagingService';

export const awMessageParamsRenderFunction = ( props ) => {
    let localizedMessage = messagingService.applyMessageParams( props.message ? props.message : '', props.params, props.context );
    return (
        <div>
            {localizedMessage}
        </div>
    );
};
